use std::intrinsics::copy_nonoverlapping;
use crypto::hash::k12_bytes;
use crypto::qubic_identities::{get_public_key_from_identity, verify};
use crate::ARBITRATOR;
use crate::computor::BroadcastComputors;
use crate::consensus_tests::epoch_163_computors;

pub type TransactionDigest = [u8; 32];

#[derive(Debug, Clone)]
pub struct TickData {
    pub computor_index: u16,
    pub epoch: u16,
    pub tick: u32,

    pub millisecond: u16,
    pub second: u8,
    pub minute: u8,
    pub hour: u8,
    pub day: u8,
    pub month: u8,
    pub year: u8,

    pub time_lock: [u8; 32],
    pub transaction_digests: [TransactionDigest; 1024],
    pub contract_fees: [i64; 1024],

    pub signature: [u8; 64]
}

impl TickData {
    pub fn as_bytes_without_signature(&self) -> [u8; size_of::<TickData>()-64] {
        let mut bytes: [u8; size_of::<TickData>()-64] = [0; size_of::<TickData>()-64];

        bytes[0..2].copy_from_slice(&self.computor_index.to_le_bytes());
        bytes[2..4].copy_from_slice(&self.epoch.to_le_bytes());
        bytes[4..8].copy_from_slice(&self.tick.to_le_bytes());
        bytes[8..10].copy_from_slice(&self.millisecond.to_le_bytes());
        bytes[10] = self.second;
        bytes[11] = self.minute;
        bytes[12] = self.hour;
        bytes[13] = self.day;
        bytes[14] = self.month;
        bytes[15] = self.year;

        bytes[16..48].copy_from_slice(&self.time_lock);

        for (index, digest) in self.transaction_digests.iter().enumerate() {
            bytes[48 + (index*size_of::<TransactionDigest>())..48 + (index*size_of::<TransactionDigest>()) + size_of::<TransactionDigest>()].copy_from_slice(digest);
        }
        for (index, fee) in self.contract_fees.iter().enumerate() {
            let _fee: [u8; 8] = fee.to_le_bytes();
            bytes[48 + size_of::<[TransactionDigest; 1024]>() + (index*8)..48 + size_of::<[TransactionDigest; 1024]>() + (index*8) + 8].copy_from_slice(&_fee);
        }
        bytes
    }
    pub fn print(&self) {
        println!("-----\nTick:\n\ttick.({})\n\tcomputor.({})\n\tepoch.({})\n\tnum_txs.({})\n\tsig: {:?}\n-----",
                 self.tick,
                 self.computor_index,
                 self.epoch,
                 self.transaction_digests.len(),
                 &self.signature);
    }
    pub fn new(data: &Vec<u8>) -> TickData {
        // println!("Tick={}", tick);
        let tx_digests : [TransactionDigest; 1024] =
            <Vec<TransactionDigest>>::try_from(
                data[48..32816].chunks_exact(size_of::<TransactionDigest>())
                .map(|chunk| <TransactionDigest>::try_from(chunk).unwrap())
                .collect::<Vec<_>>()
            ).unwrap()
                .try_into().unwrap();

        let contract_fees : [i64; 1024] =
                <Vec<i64>>::try_from(
                    data[32816..32816 + (8 * 1024)]
                        .chunks_exact(8)
                        .map(|chunk| i64::from_le_bytes(<[u8; 8]>::try_from(chunk).unwrap()))
                        .collect::<Vec<_>>()
                ).unwrap()
                    .try_into().unwrap();
        let mut signature: [u8; 64] = [0u8; 64];
        signature.copy_from_slice(&data[32816 + (1024 * 8)..]);
        TickData {
            computor_index: u16::from_le_bytes([data[0], data[1]]),
            epoch: u16::from_le_bytes([data[2], data[3]]),
            tick: u32::from_le_bytes([data[4], data[5], data[6], data[7]]),
            millisecond: u16::from_le_bytes([data[8], data[9]]),
            second: u8::from_le_bytes([data[10]]),
            minute: u8::from_le_bytes([data[11]]),
            hour: u8::from_le_bytes([data[12]]),
            day: u8::from_le_bytes([data[13]]),
            month: u8::from_le_bytes([data[14]]),
            year: u8::from_le_bytes([data[15]]),

            time_lock: data[16..48].try_into().unwrap(),
            transaction_digests: tx_digests,
            contract_fees,
            signature
        }
    }

    pub fn hash(&mut self) -> [u8; 32] {
        let hash: Vec<u8> = k12_bytes(&self.as_bytes_without_signature().to_vec());
        <[u8; 32]>::try_from(hash.as_slice()).unwrap()
    }

    pub fn validate(&mut self, bc: &BroadcastComputors) -> bool {
        self.computor_index = self.computor_index ^ 8;
        let _hash: [u8; 32] = self.hash();
        self.computor_index = self.computor_index ^ 8;
        let hash: [u8; 32] = <[u8; 32]>::try_from(_hash.as_slice()).unwrap();
        verify(&bc.pub_keys[self.computor_index as usize], &hash, &self.signature)
    }
}


